Wikipedia - I Dreamed a Dream is the debut album from Scottish singer Susan Boyle. It was released on 23 November 2009 by Syco Music in the UK, and by Columbia Records in the US one day later. I Dreamed a Dream became Amazon.com's best-selling album in pre-sales on 4 September 2009, three months before the scheduled release. It is currently at its fourth week at the top of the album chart In Britain, Boyle's debut album was confirmed as the fastest selling UK debut album of all time selling 411,820 copies beating the previous fastest selling debut of all time, Spirit by Leona Lewis. It also outsold the rest of the top 5 albums combined. I Dreamed a Dream debuted at #1 on the U.S. Billboard 200 with 701,000 copies sold in its first week, breaking the record for the highest debut ever for a new solo female artist in the Soundscan era. I Dreamed a Dream became the biggest opening sales week of 2009 in the United States, beating out Eminem's Relapse which sold 608,000.

Amazon.com - She captured the hearts of millions and became a worldwidephenomenon with over 300 million hits. An inspiration for those who have a dream, the talented Susan Boyle presents her stunning debut album. Susan surprised the world with her powerful, heart stopping voice when she walked onto the Britain's Got Talent stage. Now with a beautiful and diverse album she will, once again, defy preconceptions. I Dreamed a Dream, the album, crafted by world acclaimed producer Steve Mac, demonstrates Susan Boyle's extensive musical ability. Featuring her signature songs, `I Dreamed a Dream' &amp; `Cry me a River' the album also includes a haunting rendition of Rolling Stones &quot;Wild Horses&quot;, Madonna's `You'll See, The Monkees `Daydream Believer' and &quot;Who I Was Born To Be&quot; an original recording written specially for Susan. Susan enthused; &quot;It was my greatest ambition to release an album and I have finally achieved it. This amazing journey has helped me find my own identity and fulfill my wish. There is happiness out there for everyone who dares to dream.&quot;

